import React from 'react';
import {
  Box,
  Grid,
  Paper,
  Typography,
  Card,
  CardContent,
} from '@mui/material';
import {
  LibraryBooks as LibraryIcon,
  Code as CodeIcon,
  Assignment as TaskIcon,
  Group as TeamIcon,
} from '@mui/icons-material';

const StatCard: React.FC<{
  title: string;
  value: string | number;
  icon: React.ReactNode;
}> = ({ title, value, icon }) => (
  <Card>
    <CardContent>
      <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
        {icon}
        <Typography variant="h6" component="div" sx={{ ml: 1 }}>
          {title}
        </Typography>
      </Box>
      <Typography variant="h4" component="div">
        {value}
      </Typography>
    </CardContent>
  </Card>
);

const Dashboard: React.FC = () => {
  // TODO: Replace with actual data from Redux store
  const stats = [
    {
      title: 'Resources',
      value: 24,
      icon: <LibraryIcon color="primary" fontSize="large" />,
    },
    {
      title: 'Active Projects',
      value: 8,
      icon: <CodeIcon color="primary" fontSize="large" />,
    },
    {
      title: 'Tasks',
      value: 42,
      icon: <TaskIcon color="primary" fontSize="large" />,
    },
    {
      title: 'Team Members',
      value: 12,
      icon: <TeamIcon color="primary" fontSize="large" />,
    },
  ];

  return (
    <Box>
      <Typography variant="h4" component="h1" gutterBottom>
        Dashboard
      </Typography>
      <Grid container spacing={3}>
        {stats.map((stat) => (
          <Grid key={stat.title} xs={12} sm={6} md={3}>
            <StatCard {...stat} />
          </Grid>
        ))}
      </Grid>
      <Box sx={{ mt: 4 }}>
        <Paper sx={{ p: 3 }}>
          <Typography variant="h5" gutterBottom>
            Recent Activity
          </Typography>
          <Typography color="text.secondary">
            No recent activity to display.
          </Typography>
        </Paper>
      </Box>
    </Box>
  );
};

export default Dashboard;
